from typing import List

class Solution:
    def jump(self, nums: List[int]) -> int:
        n = len(nums)
        solution = [10001] * n
        solution[0] = 0
        for i in range(n):
            num = nums[i]
            for j in range(1, num + 1):
                if (i + j) >= n:
                    continue
                if (solution[i] + 1) < solution[i + j]:
                    solution[i + j] = solution[i] + 1

        return solution[n - 1]


